import React from 'react';
import { Layout, Button, Modal } from 'antd';

const state = { visible: false };

const showModal = () => {
  setState({
    visible: true,
  });
};

const handleOk = e => {
  console.log(e);
  setState({
    visible: false,
  });
};

const handleCancel = e => {
  console.log(e);
  setState({
    visible: false,
  });
};

const Dashboard = () =>
  <>
  <Layout style={{ margin: 20, background: 'white' }}>
  <section style={{}}>
    <Button size="large" type="primary" href="/newtrade">Add trade link</Button>
    <Button type="primary" onClick={showModal}>
      Open Modal
    </Button>
    <Modal
          title="Basic Modal"
          visible={state.visible}
          onOk={handleOk}
          onCancel={handleCancel}
        >
          <p>Some contents...</p>
          <p>Some contents...</p>
          <p>Some contents...</p>
    </Modal>
  </section>
  </Layout>
  </>

export default Dashboard
